import zero from "./0.png";
import one from "./1.png";
import two from "./2.png";

export const images = {
    zero,
    one,
    two
}

export const imagesWithAltText = [
    {
        img: zero,
        alt: "zero"
    },
    {
        img: one,
        alt: "one"
    },
    {
        img: two,
        alt: "two"
    }
]
